        // On the first call to nonReentrant, _status will be NOT_ENTERED
        if (_status == ENTERED) {
            revert ReentrancyGuardReentrantCall();
        }

        // Any calls to nonReentrant after this point will fail
        _status = ENTERED;
    }

    function _nonReentrantAfter() private {
        // By storing the original value once again, a refund is triggered (see
        // https://eips.ethereum.org/EIPS/eip-2200)
        _status = NOT_ENTERED;
    }

    /**
     * @dev Returns true if the reentrancy guard is currently set to "entered", which indicates there is a
     * `nonReentrant` function in the call stack.
     */
    function _reentrancyGuardEntered() internal view returns (bool) {
        return _status == ENTERED;
    }
}

contracts/AccumulatingVault.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.27;

import "../interfaces/IUniswapV2Router02.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

/**
 * @title AccumulatingVault
 * @dev Contract for managing reflection rewards and liquidity provision
 * 
 * This contract receives MOTO tokens from the main contract as fees,
 * converts them to ETH, and manages both reflection rewards distribution
 * and automatic liquidity provision to the MOTO/ETH pool.
 */
contract AccumulatingVault is Ownable, ReentrancyGuard {
    // BaseSwap Router interface
    IUniswapV2Router02 public immutable router;

    // MOTO token contract
    IERC20 public immutable motoToken;

    // Reward distribution tracking
    mapping(address => uint256) public rewards;
    mapping(address => uint256) public lastClaimTime;

    // Total rewards distributed
    uint256 public totalRewardsDistributed;
    uint256 public totalETHForRewards;
    uint256 public totalETHForLiquidity;

    // Distribution settings
    uint256 public rewardPercentage = 60; // 60% of converted ETH goes to rewards
    uint256 public liquidityPercentage = 40; // 40% goes to liquidity

    // Minimum amounts for operations
    uint256 public minTokensForConversion = 500 * 10**18; // 500 MOTO
    uint256 public minETHForLiquidity = 0.01 ether; // 0.01 ETH

    // Slippage protection
    uint256 public maxSlippage = 500; // 5% in basis points

    // Claim cooldown (to prevent spam)
    uint256 public claimCooldown = 1 hours;

    // Events
    event TokensConverted(uint256 tokensConverted, uint256 ethReceived);
    event RewardsDistributed(uint256 totalHolders, uint256 totalETH);
    event RewardsClaimed(address indexed user, uint256 amount);
    event LiquidityAdded(uint256 tokenAmount, uint256 ethAmount, uint256 liquidity);
    event PercentagesUpdated(uint256 rewardPercentage, uint256 liquidityPercentage);
    event MinAmountsUpdated(uint256 minTokens, uint256 minETH);

    /**
     * @dev Constructor
     * @param _motoToken Address of the MOTO token contract
     * @param _router Address of the BaseSwap router
     * @param initialOwner Address of the initial owner
     */
    constructor(
        address _motoToken,
        address _router,
        address initialOwner
    ) Ownable(initialOwner) {
        require(_motoToken != address(0), "AccumulatingVault: invalid MOTO token address");
        require(_router != address(0), "AccumulatingVault: invalid router address");
        require(initialOwner != address(0), "AccumulatingVault: invalid owner address");

        motoToken = IERC20(_motoToken);
        router = IUniswapV2Router02(_router);
    }

    /**
     * @dev Updates the distribution percentages
     * @param _rewardPercentage Percentage for rewards (0-100)
     * @param _liquidityPercentage Percentage for liquidity (0-100)
     */
    function updatePercentages(uint256 _rewardPercentage, uint256 _liquidityPercentage) external onlyOwner {
        require(_rewardPercentage + _liquidityPercentage == 100, "AccumulatingVault: percentages must sum to 100");

        rewardPercentage = _rewardPercentage;
        liquidityPercentage = _liquidityPercentage;

        emit PercentagesUpdated(_rewardPercentage, _liquidityPercentage);
    }

    /**
     * @dev Updates minimum amounts for operations
     * @param _minTokens Minimum tokens for conversion
     * @param _minETH Minimum ETH for liquidity addition
     */
    function updateMinAmounts(uint256 _minTokens, uint256 _minETH) external onlyOwner {
        minTokensForConversion = _minTokens;
        minETHForLiquidity = _minETH;

        emit MinAmountsUpdated(_minTokens, _minETH);
    }

    /**
     * @dev Updates maximum slippage tolerance
     * @param _maxSlippage New maximum slippage in basis points
     */
    function updateMaxSlippage(uint256 _maxSlippage) external onlyOwner {
        require(_maxSlippage <= 2000, "AccumulatingVault: slippage too high"); // Max 20%
        maxSlippage = _maxSlippage;
    }

    /**
     * @dev Updates claim cooldown period
     * @param _cooldown New cooldown period in seconds
     */
    function updateClaimCooldown(uint256 _cooldown) external onlyOwner {
        require(_cooldown <= 24 hours, "AccumulatingVault: cooldown too long");
        claimCooldown = _cooldown;
    }

    /**
     * @dev Converts MOTO tokens to ETH and distributes for rewards and liquidity
     * Can be called by anyone when conditions are met
     */
    function processTokens() external nonReentrant {
        uint256 tokenBalance = motoToken.balanceOf(address(this));
        require(tokenBalance >= minTokensForConversion, "AccumulatingVault: insufficient tokens");

        // Convert tokens to ETH
        uint256 ethReceived = _swapTokensForETH(tokenBalance);
        require(ethReceived > 0, "AccumulatingVault: no ETH received");

        // Distribute ETH between rewards and liquidity
        uint256 ethForRewards = (ethReceived * rewardPercentage) / 100;
        uint256 ethForLiquidity = ethReceived - ethForRewards;

        totalETHForRewards += ethForRewards;
        totalETHForLiquidity += ethForLiquidity;

        emit TokensConverted(tokenBalance, ethReceived);

        // Add liquidity if we have enough ETH
        if (ethForLiquidity >= minETHForLiquidity) {
            _addLiquidity(ethForLiquidity);
        }
    }

    /**
     * @dev Distributes rewards to a batch of holders
     * @param holders Array of holder addresses
     */
    function distributeRewards(address[] calldata holders) external nonReentrant {
        require(totalETHForRewards > 0, "AccumulatingVault: no ETH available for rewards");
        require(holders.length > 0, "AccumulatingVault: no holders provided");
        require(holders.length <= 100, "AccumulatingVault: too many holders in batch");

        uint256 totalSupply = motoToken.totalSupply();
        uint256 ethToDistribute = totalETHForRewards;
        uint256 totalDistributed = 0;

        for (uint256 i = 0; i < holders.length; i++) {
            address holder = holders[i];
            uint256 balance = motoToken.balanceOf(holder);

            if (balance > 0) {
                uint256 reward = (ethToDistribute * balance) / totalSupply;
                if (reward > 0) {
                    rewards[holder] += reward;
                    totalDistributed += reward;
                }
            }
        }

        totalETHForRewards -= totalDistributed;
        totalRewardsDistributed += totalDistributed;

        emit RewardsDistributed(holders.length, totalDistributed);
    }

    /**
     * @dev Allows users to claim their accumulated rewards
     */
    function claimRewards() external nonReentrant {
        address user = msg.sender;
        require(rewards[user] > 0, "AccumulatingVault: no rewards to claim");
        require(
            block.timestamp >= lastClaimTime[user] + claimCooldown,
            "AccumulatingVault: claim cooldown not met"
        );

        uint256 reward = rewards[user];
        rewards[user] = 0;
        lastClaimTime[user] = block.timestamp;

        // Transfer ETH reward to user
        (bool success, ) = payable(user).call{value: reward}("");
        require(success, "AccumulatingVault: ETH transfer failed");

        emit RewardsClaimed(user, reward);
    }

    /**
     * @dev Swaps MOTO tokens for ETH
     * @param tokenAmount Amount of tokens to swap
     * @return ethReceived Amount of ETH received
     */
    function _swapTokensForETH(uint256 tokenAmount) private returns (uint256 ethReceived) {
        // Approve router to spend tokens
        motoToken.approve(address(router), tokenAmount);

        // Set up swap path: MOTO -> WETH
        address[] memory path = new address[](2);
        path[0] = address(motoToken);
        path[1] = router.WETH();

        // Calculate minimum ETH out with slippage protection
        uint256[] memory amountsOut = router.getAmountsOut(tokenAmount, path);
        uint256 minETHOut = (amountsOut[1] * (10000 - maxSlippage)) / 10000;

        // Record ETH balance before swap
        uint256 ethBefore = address(this).balance;

        // Execute swap
        router.swapExactTokensForETH(
            tokenAmount,
            minETHOut,
            path,
            address(this),
            block.timestamp + 300 // 5 minute deadline
        );

        // Calculate ETH received
        ethReceived = address(this).balance - ethBefore;
    }

    /**
     * @dev Adds liquidity to the MOTO/ETH pool
     * @param ethAmount Amount of ETH to use for liquidity
     */
    function _addLiquidity(uint256 ethAmount) private {
        // Calculate how many tokens we need for the ETH amount
        address[] memory path = new address[](2);
        path[0] = router.WETH();
        path[1] = address(motoToken);

        uint256[] memory amountsOut = router.getAmountsOut(ethAmount / 2, path);
        uint256 tokensNeeded = amountsOut[1];

        // Buy tokens with half the ETH
        uint256 minTokensOut = (tokensNeeded * (10000 - maxSlippage)) / 10000;

        uint256[] memory amounts = router.swapExactETHForTokens{value: ethAmount / 2}(
            minTokensOut,
            path,
            address(this),
            block.timestamp + 300
        );

        uint256 tokensBought = amounts[1];
        uint256 ethForLiquidity = ethAmount / 2;

        // Approve router to spend tokens
        motoToken.approve(address(router), tokensBought);

        // Add liquidity
        (uint256 tokenAmount, uint256 ethUsed, uint256 liquidity) = router.addLiquidityETH{value: ethForLiquidity}(
            address(motoToken),
            tokensBought,
            (tokensBought * (10000 - maxSlippage)) / 10000, // Min tokens
            (ethForLiquidity * (10000 - maxSlippage)) / 10000, // Min ETH
            owner(), // LP tokens go to owner
            block.timestamp + 300
        );

        emit LiquidityAdded(tokenAmount, ethUsed, liquidity);
    }

    /**
     * @dev Gets user's claimable rewards and next claim time
     * @param user User address
     * @return claimableAmount Amount user can claim
     * @return nextClaimTime When user can claim next
     */
    function getUserRewardInfo(address user) external view returns (uint256 claimableAmount, uint256 nextClaimTime) {
        claimableAmount = rewards[user];
        nextClaimTime = lastClaimTime[user] + claimCooldown;
        if (nextClaimTime < block.timestamp) {
            nextClaimTime = block.timestamp;
        }
    }

    /**
     * @dev Checks if token processing can be executed
     * @return canProcess Whether processing can be executed
     * @return tokenBalance Current token balance
     */
    function canProcessTokens() external view returns (bool canProcess, uint256 tokenBalance) {
        tokenBalance = motoToken.balanceOf(address(this));
        canProcess = tokenBalance >= minTokensForConversion;
    }

    /**
     * @dev Emergency function to withdraw tokens (only owner)
     * @param token Token address to withdraw
     * @param amount Amount to withdraw
     */
    function emergencyWithdrawToken(address token, uint256 amount) external onlyOwner {
        IERC20(token).transfer(owner(), amount);
    }

    /**
     * @dev Emergency function to withdraw ETH (only owner)
     */
    function emergencyWithdrawETH() external onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }

    /**
     * @dev Receive function to accept ETH
     */
    receive() external payable {}

    /**
     * @dev Fallback function
     */
    fallback() external payable {}
}

contracts/Buyback.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.27;

import "../interfaces/IUniswapV2Router02.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

/**
 * @title Buyback
 * @dev Contract responsible for buying back MOTO tokens and burning them
 * 
 * This contract receives MOTO tokens from the main contract as fees,
 * swaps them for ETH via BaseSwap, and then uses that ETH to buy back
 * more MOTO tokens which are sent to a burn address.
 */
contract Buyback is Ownable, ReentrancyGuard {
    // BaseSwap Router interface
    IUniswapV2Router02 public immutable router;

    // MOTO token contract
    IERC20 public immutable motoToken;

    // Burn address (dead address)
    address public constant DEAD = 0x000000000000000000000000000000000000dEaD;

    // Minimum token amount to trigger buyback
    uint256 public minTokensForBuyback = 1000 * 10**18; // 1000 MOTO

    // Slippage protection (in basis points, 500 = 5%)
    uint256 public maxSlippage = 500;

    // Events
    event BuybackExecuted(uint256 tokensSwappedForETH, uint256 ethReceived, uint256 tokensBought, uint256 tokensBurned);
    event MinTokensUpdated(uint256 newMinTokens);
    event MaxSlippageUpdated(uint256 newMaxSlippage);
    event EmergencyWithdraw(address token, uint256 amount);

    /**
     * @dev Constructor
     * @param _motoToken Address of the MOTO token contract
     * @param _router Address of the BaseSwap router
     * @param initialOwner Address of the initial owner
     */
    constructor(
        address _motoToken,
        address _router,
        address initialOwner
    ) Ownable(initialOwner) {
        require(_motoToken != address(0), "Buyback: invalid MOTO token address");
        require(_router != address(0), "Buyback: invalid router address");
        require(initialOwner != address(0), "Buyback: invalid owner address");

        motoToken = IERC20(_motoToken);
        router = IUniswapV2Router02(_router);
    }

    /**
     * @dev Updates minimum tokens required for buyback
     * @param _minTokens New minimum token amount
     */
    function updateMinTokensForBuyback(uint256 _minTokens) external onlyOwner {
        minTokensForBuyback = _minTokens;
        emit MinTokensUpdated(_minTokens);
    }

    /**
     * @dev Updates maximum slippage tolerance
     * @param _maxSlippage New maximum slippage in basis points
     */
    function updateMaxSlippage(uint256 _maxSlippage) external onlyOwner {
        require(_maxSlippage <= 2000, "Buyback: slippage too high"); // Max 20%
        maxSlippage = _maxSlippage;
        emit MaxSlippageUpdated(_maxSlippage);
    }

    /**
     * @dev Executes buyback and burn process
     * Can be called by anyone when conditions are met
     */
    function executeBuyback() external nonReentrant {
        uint256 tokenBalance = motoToken.balanceOf(address(this));
        require(tokenBalance >= minTokensForBuyback, "Buyback: insufficient tokens for buyback");

        // Step 1: Swap MOTO tokens for ETH
        uint256 ethReceived = _swapTokensForETH(tokenBalance);
        require(ethReceived > 0, "Buyback: no ETH received from swap");

        // Step 2: Use ETH to buy MOTO tokens and send to burn address
        uint256 tokensBought = _buyTokensAndBurn(ethReceived);

        emit BuybackExecuted(tokenBalance, ethReceived, tokensBought, tokensBought);
    }

    /**
     * @dev Swaps MOTO tokens for ETH
     * @param tokenAmount Amount of tokens to swap
     * @return ethReceived Amount of ETH received
     */
    function _swapTokensForETH(uint256 tokenAmount) private returns (uint256 ethReceived) {
        // Approve router to spend tokens
        motoToken.approve(address(router), tokenAmount);

        // Set up swap path: MOTO -> WETH
        address[] memory path = new address[](2);
        path[0] = address(motoToken);
        path[1] = router.WETH();

        // Calculate minimum ETH out with slippage protection
        uint256[] memory amountsOut = router.getAmountsOut(tokenAmount, path);
        uint256 minETHOut = (amountsOut[1] * (10000 - maxSlippage)) / 10000;

        // Record ETH balance before swap
        uint256 ethBefore = address(this).balance;

        // Execute swap
        router.swapExactTokensForETH(
            tokenAmount,
            minETHOut,
            path,
            address(this),
            block.timestamp + 300 // 5 minute deadline
        );

        // Calculate ETH received
        ethReceived = address(this).balance - ethBefore;
    }

    /**
     * @dev Buys MOTO tokens with ETH and sends them to burn address
     * @param ethAmount Amount of ETH to use for buying
     * @return tokensBought Amount of tokens bought and burned
     */
    function _buyTokensAndBurn(uint256 ethAmount) private returns (uint256 tokensBought) {
        // Set up swap path: WETH -> MOTO
        address[] memory path = new address[](2);
        path[0] = router.WETH();
        path[1] = address(motoToken);

        // Calculate minimum tokens out with slippage protection
        uint256[] memory amountsOut = router.getAmountsOut(ethAmount, path);
        uint256 minTokensOut = (amountsOut[1] * (10000 - maxSlippage)) / 10000;

        // Execute swap - tokens go directly to burn address
        uint256[] memory amounts = router.swapExactETHForTokens{value: ethAmount}(
            minTokensOut,
            path,
            DEAD, // Send tokens directly to burn address
            block.timestamp + 300 // 5 minute deadline
        );

        tokensBought = amounts[1];
    }

    /**
     * @dev Checks if buyback can be executed
     * @return canExecute Whether buyback can be executed
     * @return tokenBalance Current token balance
     */
    function canExecuteBuyback() external view returns (bool canExecute, uint256 tokenBalance) {
        tokenBalance = motoToken.balanceOf(address(this));
        canExecute = tokenBalance >= minTokensForBuyback;
    }

    /**
     * @dev Gets expected ETH amount for current token balance
     * @return expectedETH Expected ETH amount from swapping current tokens
     */
    function getExpectedETHFromTokens() external view returns (uint256 expectedETH) {
        uint256 tokenBalance = motoToken.balanceOf(address(this));
        if (tokenBalance == 0) return 0;

        address[] memory path = new address[](2);
        path[0] = address(motoToken);
        path[1] = router.WETH();

        try router.getAmountsOut(tokenBalance, path) returns (uint256[] memory amounts) {
            expectedETH = amounts[1];
        } catch {
            expectedETH = 0;
        }
    }

    /**
     * @dev Emergency function to withdraw tokens (only owner)
     * @param token Token address to withdraw
     * @param amount Amount to withdraw
     */
    function emergencyWithdrawToken(address token, uint256 amount) external onlyOwner {
        IERC20(token).transfer(owner(), amount);
        emit EmergencyWithdraw(token, amount);
    }

    /**
     * @dev Emergency function to withdraw ETH (only owner)
     */
    function emergencyWithdrawETH() external onlyOwner {
        uint256 balance = address(this).balance;
        payable(owner()).transfer(balance);
        emit EmergencyWithdraw(address(0), balance);
    }

    /**
     * @dev Receive function to accept ETH
     */
    receive() external payable {}

    /**
     * @dev Fallback function
     */
    fallback() external payable {}
}

contracts/LiquidityLocker.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.27;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

/**
 * @title LiquidityLocker
 * @dev Contract for locking liquidity tokens for a specified period
 * 
 * This contract locks LP tokens to provide assurance to investors
 * that liquidity cannot be removed (preventing rug pulls).
 */
contract LiquidityLocker is Ownable, ReentrancyGuard {
    struct LockInfo {
        address token;          // LP token address
        uint256 amount;         // Amount of tokens locked
        uint256 lockTime;       // When tokens were locked
        uint256 unlockTime;     // When tokens can be unlocked
        address beneficiary;    // Who can withdraw the tokens
        bool withdrawn;         // Whether tokens have been withdrawn
    }

    // Lock storage
    mapping(uint256 => LockInfo) public locks;
    mapping(address => uint256[]) public userLocks;
    uint256 public nextLockId = 1;

    // Minimum lock period (1 year)
    uint256 public constant MIN_LOCK_PERIOD = 365 days;

    // Events
    event TokensLocked(
        uint256 indexed lockId,
        address indexed token,
        address indexed beneficiary,
        uint256 amount,
        uint256 unlockTime
    );

    event TokensWithdrawn(
        uint256 indexed lockId,
        address indexed token,
        address indexed beneficiary,
        uint256 amount
    );

    event LockExtended(
        uint256 indexed lockId,
        uint256 newUnlockTime
    );

    /**
     * @dev Constructor
     * @param initialOwner Address of the initial owner
     */
    constructor(address initialOwner) Ownable(initialOwner) {
        require(initialOwner != address(0), "LiquidityLocker: invalid owner address");
    }

    /**
     * @dev Locks tokens for a specified period
     * @param token Address of the token to lock
     * @param amount Amount of tokens to lock
     * @param lockPeriod Lock period in seconds (minimum 1 year)
     * @param beneficiary Address that can withdraw tokens after unlock
     * @return lockId The ID of the created lock
     */
    function lockTokens(
        address token,
        uint256 amount,
        uint256 lockPeriod,
        address beneficiary
    ) external nonReentrant returns (uint256 lockId) {
        require(token != address(0), "LiquidityLocker: invalid token address");
        require(amount > 0, "LiquidityLocker: amount must be greater than zero");
        require(lockPeriod >= MIN_LOCK_PERIOD, "LiquidityLocker: lock period too short");
        require(beneficiary != address(0), "LiquidityLocker: invalid beneficiary address");

        // Transfer tokens to this contract
        IERC20(token).transferFrom(msg.sender, address(this), amount);

        // Create lock
        lockId = nextLockId++;
        uint256 unlockTime = block.timestamp + lockPeriod;

        locks[lockId] = LockInfo({
            token: token,
            amount: amount,
            lockTime: block.timestamp,
            unlockTime: unlockTime,
            beneficiary: beneficiary,
            withdrawn: false
        });

        userLocks[beneficiary].push(lockId);

        emit TokensLocked(lockId, token, beneficiary, amount, unlockTime);
    }

    /**
     * @dev Withdraws tokens after the lock period has expired
     * @param lockId ID of the lock to withdraw from
     */
    function withdrawTokens(uint256 lockId) external nonReentrant {
        LockInfo storage lock = locks[lockId];

        require(lock.amount > 0, "LiquidityLocker: lock does not exist");
        require(!lock.withdrawn, "LiquidityLocker: tokens already withdrawn");
        require(msg.sender == lock.beneficiary, "LiquidityLocker: not beneficiary");
        require(block.timestamp >= lock.unlockTime, "LiquidityLocker: tokens still locked");

        lock.withdrawn = true;

        // Transfer tokens to beneficiary
        IERC20(lock.token).transfer(lock.beneficiary, lock.amount);

        emit TokensWithdrawn(lockId, lock.token, lock.beneficiary, lock.amount);
    }

    /**
     * @dev Extends the lock period (can only increase, not decrease)
     * @param lockId ID of the lock to extend
     * @param newUnlockTime New unlock timestamp (must be later than current)
     */
    function extendLock(uint256 lockId, uint256 newUnlockTime) external {
        LockInfo storage lock = locks[lockId];

        require(lock.amount > 0, "LiquidityLocker: lock does not exist");
        require(!lock.withdrawn, "LiquidityLocker: tokens already withdrawn");
        require(msg.sender == lock.beneficiary, "LiquidityLocker: not beneficiary");
        require(newUnlockTime > lock.unlockTime, "LiquidityLocker: can only extend lock");

        lock.unlockTime = newUnlockTime;

        emit LockExtended(lockId, newUnlockTime);
    }

    /**
     * @dev Gets lock information
     * @param lockId ID of the lock
     * @return lock information
     */
    function getLockInfo(uint256 lockId) external view returns (LockInfo memory) {
        return locks[lockId];
    }

    /**
     * @dev Gets all lock IDs for a user
     * @param user User address
     * @return Array of lock IDs
     */
    function getUserLocks(address user) external view returns (uint256[] memory) {
        return userLocks[user];
    }

    /**
     * @dev Gets the number of locks for a user
     * @param user User address
     * @return Number of locks
     */
    function getUserLockCount(address user) external view returns (uint256) {
        return userLocks[user].length;
    }

    /**
     * @dev Checks if tokens can be withdrawn from a lock
     * @param lockId ID of the lock
     * @return canWithdraw Whether tokens can be withdrawn
     * @return timeRemaining Time remaining until unlock (0 if can withdraw)
     */
    function canWithdraw(uint256 lockId) external view returns (bool canWithdraw, uint256 timeRemaining) {
        LockInfo storage lock = locks[lockId];

        if (lock.amount == 0 || lock.withdrawn) {
            return (false, 0);
        }

        if (block.timestamp >= lock.unlockTime) {
            return (true, 0);
        } else {
            return (false, lock.unlockTime - block.timestamp);
        }
    }

    /**
     * @dev Gets total locked amount for a specific token
     * @param token Token address
     * @return totalLocked Total amount locked for the token
     */
    function getTotalLocked(address token) external view returns (uint256 totalLocked) {
        for (uint256 i = 1; i < nextLockId; i++) {
            LockInfo storage lock = locks[i];
            if (lock.token == token && !lock.withdrawn) {
                totalLocked += lock.amount;
            }
        }
    }

    /**
     * @dev Emergency function to recover accidentally sent tokens (only owner)
     * This can only recover tokens that are not part of any active lock
     * @param token Token address to recover
     * @param amount Amount to recover
     */
    function emergencyRecoverToken(address token, uint256 amount) external onlyOwner {
        uint256 totalLocked = this.getTotalLocked(token);
        uint256 contractBalance = IERC20(token).balanceOf(address(this));

        require(contractBalance >= totalLocked + amount, "LiquidityLocker: cannot recover locked tokens");

        IERC20(token).transfer(owner(), amount);
    }
}

